import Dog from "./Dog";
import React, { useState } from "react";
import "../stylesheets/layouts/DogList.scss";
import noright from "../images/arrowleft.png";
import noleft from "../images/arrowright.png";
import right from "../images/arrowL.png";
import left from "../images/arrowR.png";

const DogList = (props) => {
  const handleClickPrev = () => {
    setIndex(index - 1);
  };
  const handleClickSig = () => {
    setIndex(index + 1);
  };
  const [index, setIndex] = useState(0);
  return (
    <>
      <li key={props.dogs.id} className="dogList">
        <Dog dogs={props.dogs[index]} />
      </li>
      {index > 0 ? (
        <button className="button__prev" onClick={handleClickPrev}>
          <img className="button__arrow" src={right} alt="cant go left" />
        </button>
      ) : (
        <button className="button__prev--empty">
          {" "}
          <img className="button__arrow" src={noright} alt="cant go left" />
        </button>
      )}
      {index <= props.dogs.length ? (
        <button className="button__sig" onClick={handleClickSig}>
          <img className="button__arrow" src={left} alt="go left" />
        </button>
      ) : (
        <button className="button__sig--empty">
          <img className="button__arrow" src={noleft} alt="cant go left" />
        </button>
      )}
    </>
  );
};

export default DogList;
